import React from "react"
import '../assets/css/Busquedas.css'

import {Container, Row, Col, Form, Card, Button} from 'react-bootstrap'
import InfiniteGrid from 'react-infinite-grid';

import ScrollerResultados from './Busquedas/ScrollerResultados'
import FormularioBusquedas from './Busquedas/FormularioBusquedas'

class objeto_pregunta extends React.Component{
  constructor(props){
    super(props)

  }

  render(){
    return(
    <Card border="success" style={{ width: '18rem' }}>
      <Card.Header>pregunta num {this.props.numero}</Card.Header>
      <Card.Body>
        <Card.Title>Success Card Title</Card.Title>
        <Card.Text>
          Some quick example text to build on the card title and make up the bulk
          of the card's content.
        </Card.Text>
      </Card.Body>
    </Card>
    )
  }
}


class Busquedas extends React.Component{
  constructor(props) {
    super(props);
    this.state ={
      resultados: [''],
      pulsado_boton_busqueda:true
    }
    this.realizarBusqueda = this.realizarBusqueda.bind(this)
  }

  realizarBusqueda(){
    this.state.pulsado_boton_busqueda = !this.state.pulsado_boton_busqueda
    console.log('Holi')
    console.log(this.state.pulsado_boton_busqueda)
  }

  render(){
    return(
      <Container id='component_busqueda' fluid='true'>
        <Row top="xs">
          <Col md={4}>
            <FormularioBusquedas realizarBusqueda={this.realizarBusqueda}/>
          </Col>
          <Col>
              <ScrollerResultados/>
          </Col>
        </Row>
      </Container>
    )
  }
}

export default Busquedas
